 vitesh. I Punësuari do të marrë të gjitha masat e arsyeshme për të mbrojtur dhe ruajtur informacionin konfidencial nga zbulimi i paautorizuar ose përdorimi i paautorizuar.

Neni 9: Ndërprerja e Kontratës 

Me marrëveshje me pëlqimin e të Punësuarit/es dhe Punëdhënësit Sipas fuqisë së ligjit në rastet sikurse parashihen në nenin 67 të Ligjit të Punës apo ligjeve tjera në fuqi në Kosovë

Në mënyrë të njëanshme nga Punëdhënësi me paralajmërim prej gjashtëdhjetë (60) ditësh:

- Punëdhënësi ka arsye ekonomike, teknike apo organizative për një veprim të tillë;

- I Punësuari nuk është më i aftë të kryejë detyrat e punës;

- I Punësuari është përgjegjës për raste të rënda të shkeljes së rregullave të brendshme;

- I Punësuari nuk ka përmbushur detyrat e punës në mënyrë të kënaqshme
